import { jsPDF } from "jspdf";
var font =
  "";
var callAddFont = function () {
  this.addFileToVFS("Urbanist-VariableFont_wght-normal.ttf", font);
  this.addFont(
    "Urbanist-VariableFont_wght-normal.ttf",
    "Urbanist-VariableFont_wght",
    "normal"
  );
};
jsPDF.API.events.push(["addFonts", callAddFont]);
export default font;
